import { OssService } from '@/services/oss.service';
import { MessageService } from '@/services/message.service';
export default {
  data: function data() {
    return {
      loading: false,
      imageUrl: '',
      key: ''
    };
  },
  serviceInject: function serviceInject() {
    return {
      oss: OssService,
      messageService: MessageService
    };
  },
  methods: {
    upload: function upload(data) {
      var _this = this;

      this.loading = true;
      this.imageUrl = '';
      this.oss.put({
        file: data.file
      }).subscribe({
        next: function next(val) {
          _this.key = val.fileKey;

